import "./button.css";
import CloseRoundedIcon from "@material-ui/icons/CloseRounded";

class Exit extends React.Component {
  render() {
    return (
      <a className="exitwrap"  href="#">
          span.<CloseRoundedIcon className="exit" />
      </a>
    );
  }
}

export default Exit;
